/// @title Endless Crawler Chamber Generator v.2
/// @author Studio Avante
/// @notice Creates Chambers bitmap and provide data for ICrawlerMapper
/// @dev Upgradeable for eventual optimizations, can also be extended to generate new game data
//
pragma solidity ^0.8.16;
import { IERC165 } from '@openzeppelin/contracts/utils/introspection/IERC165.sol';
import { Math } from '@openzeppelin/contracts/utils/math/Math.sol';
import { CrawlerContract } from '../CrawlerContract.sol';
import { ICrawlerGenerator } from '../ICrawlerGenerator.sol';
import { Crawl } from '../Crawl.sol';

contract CrawlerGeneratorV2 is CrawlerContract, ICrawlerGenerator {

	constructor() {
		setupCrawlerContract('Generator', 2, 2);
	}

	/// @dev implements IERC165
	function supportsInterface(bytes4 interfaceId) public view virtual override(IERC165, CrawlerContract) returns (bool) {
		return interfaceId == type(ICrawlerGenerator).interfaceId || CrawlerContract.supportsInterface(interfaceId);
	}

	function generateCustomChamberData(Crawl.ChamberData memory chamber) public pure override returns (Crawl.CustomData[] memory result) {
		chamber.tokenId = 0; // THIS SHOULD NOT AFFECT MEMORY. If it does, tests will fail
		uint256 zero = 0;
		assembly {
			mstore(add(chamber, 32), zero)
		}

		result = new Crawl.CustomData[](2);

		// custom tile
		uint8 hatchPos = generateHatchPos(chamber.seed);
		uint8 hatchDirection = uint8(chamber.seed % 3);
		result[0] = Crawl.CustomData(Crawl.CustomDataType.Tile, abi.encodePacked(hatchPos, hatchDirection));

		// custom palette
		result[1] = Crawl.CustomData(Crawl.CustomDataType.Palette,
			'\x00\xfe\xfd'
			'\x00\xfb\x00'
			'\x00\x00\xfa'
			'\xfc\x00\x00'
			'\xfe\xfd\xfc'
		);
	}

	//-----------------------
	// Custom data generators
	//

	// TODO: Avoid tile collisions?
	function generateHatchPos(uint256 seed) public pure returns (uint8) {
		return Crawl.mapSeedToBitmapPosition(seed >> 100);
	}

}
